import React, {Component} from "react"
import {  Form, Input, Button, Checkbox  }  from'antd'
const {Item} = Form
const layout = {
    labelCol: {
      span: 8,
    },
    wrapperCol: {
      span: 16,
    },
  };
  const tailLayout = {
    wrapperCol: {
      offset: 8,
      span: 16,
    },
  };
class Scan extends Component{

    render(){




          return (
            <Form
              {...layout}
              name="basic"
              initialvalues={{
                remember: true,
              }}

            >
              <Item
                label="Name"
                name="name"
                rules={[
                  {
                    required: true,
                    message: 'Please input your name!',
                  },
                ]}
              >
                <Input />
              </Item>

              <Item
                label="Address"
                name="Address"
                rules={[
                  {
                    required: true,
                    message: 'Please input your address!',
                  },
                ]}
              >
                <Input />
              </Item>
              <Item
                label="Phone number"
                name="Phone number"
                rules={[
                  {
                    required: true,
                    message: 'Please input your phone!',
                  },
                ]}
              >
                <Input />
              </Item>

              <Item {...tailLayout} name="remember" valuePropName="checked">
                <Checkbox>Remember me</Checkbox>
              </Item>

              <Item {...tailLayout}>
                <Button type="primary" htmlType="submit" >
                  Submit
                </Button>
              </Item>
            </Form>
          );
    }
}
export default Scan
